define("services/auth",
    ["configuration", "services/transport"],
    function (configuration, transport) {
        "use strict";
        /// Method return bool value
        function isAuthenticated(callback) {
            var res = !!localStorage["username"];
            if (callback) {
                transport.request("GET", configuration.urls.isAuthenticated)
                    .done(function(data) {
                        if (data.isAuthenticated !== true) {
                            localStorage.removeItem("username");
                        } else {
                            localStorage["username"] = data.username;
                        }
                        if (callback) {
                            callback(data.isAuthenticated, data.username);
                        }
                    });
            }
            return res;
        }

        function getUsername() {
            return localStorage["username"];
        }

        function login(userName, password, rememberMe) {
            var promize = transport.request("POST",
                configuration.urls.login,
                {
                    UserName: userName,
                    Password: password,
                    RememberMe: rememberMe
                }
            ).done(function (data) {
                    localStorage["uid"] = data.uid;
                    localStorage["username"] = data.username;
                    localStorage[configuration.authCookieName] = data.cookie;
            });
            return promize;
        }

        function register(userName, password, confirmPassword) {
            var promize = transport.request("POST",
                configuration.urls.register,
                {
                    UserName: userName,
                    Password: password,
                    ConfirmPassword: confirmPassword
                }
            ).done(function (data) {
                    localStorage["uid"] = data.uid;
                    localStorage["username"] = data.username;
                    localStorage[configuration.authCookieName] = data.cookie;
            });
            return promize;
        }

        function logoff() {
            var promize = transport.request("GET", configuration.urls.logoff)
                .done(function (data) {
                    localStorage.removeItem("uid");
                    localStorage.removeItem("username");
                    localStorage.removeItem(configuration.authCookieName);
                });
            return promize;
        }

        function setCookie(){
            var promize = transport.request("GET",configuration.urls.getCookie)
                .done(function(data){
                    localStorage[configuration.authCookieName] = data.cookie;
                    localStorage["username"] = data.username;
                });
            return promize;
        }

        var service = {
            isAuthenticated: isAuthenticated,
            login: login,
            logoff: logoff,
            register: register,
            setCookie: setCookie,
            getUsername: getUsername
        };
        return service;
    }
);

define('services/threads',
    ['configuration', 'services/transport'],
    function (configuration, transport) {
        "use strict";
        var _threads;
        var _language;
        
        function getThreads(url, language, keywords) {
            var promize;
            if (_threads && _language && _language == language) {
                promize = {
                    done: function (callback) {
                        this.doneCalback = callback;
                        return this;
                    },
                    error: function (callback) {
                        this.errorCalback = callback;
                        return this;
                    }
                };
                window.setTimeout(function () { promize.doneCalback(_threads); }, 1);
                return promize;
            } else {
                _language = language;
                promize = transport.request('POST',
                    configuration.urls.getThreads,
                    { url: url, language: language, keywords: keywords }
                ).done(function (data) { _threads = data; });
                return promize;
            }
        }
        
        function searchThreads(title, language) {
            var promize = transport.request('GET',
                configuration.urls.searchThreads,
                { title: title, language: language }
            );
            return promize;
        }
        
        function addThread(title, language, url) {
            var promize = transport.request('POST',
                configuration.urls.addThread,
                { Title: title, Language: language, Url: url });
            return promize;
        }

        var service = {
            getThreads: getThreads,
            searchThreads: searchThreads,
            addThread: addThread
        };
        return service;
    }
);

define('services/languages',
    ['configuration', 'services/transport'],
    function (configuration, transport) {
        "use strict";

        var _languages;

        function getLanguages() {
            var promize;
            if (_languages) {
                promize = {
                    done: function (callback) {
                        this.doneCalback = callback;
                        return this;
                    },
                    error: function (callback) {
                        this.errorCalback = callback;
                        return this;
                    }
                };
                window.setTimeout(function () { promize.doneCalback(_languages) }, 1);
                return promize;
            } else {
                var
                languages = localStorage['allLanguages'],
                languagesUpdated = new Date(localStorage['allLanguagesUpdated']),
                now = new Date();
                if (languages != null && languages != "") {
                    try {
                        _languages = JSON.parse(languages);
                    } catch (e) {
                        _languages = null;
                        languages == null;
                        localStorage.removeItem('allLanguages');
                    }
                }
                if ((_languages != null && languages != "") || (now - languagesUpdated < 1000 * 60 * 60 * 24)) {
                    promize = {
                        done: function (callback) {
                            this.doneCalback = callback;
                            return this;
                        },
                        error: function (callback) {
                            this.errorCalback = callback;
                            return this;
                        }
                    };
                    window.setTimeout(function () { promize.doneCalback(_languages) }, 1);
                    return promize;
                }
                promize = transport.request('POST',
                    configuration.urls.getLanguages
                ).done(function (data) {
                    _languages = data;
                    localStorage['allLanguages'] = JSON.stringify(data);
                    localStorage['allLanguagesUpdated'] = new Date();
                });
                return promize;
            }
        }

        function getSelectedLanguages() {
            if (localStorage['selectedLanguages'] != null) {
                return JSON.parse(localStorage['selectedLanguages']);
            }
            return [];
        }

        function initSelectedLanguages() {
            var res = [];
            if (Array.isArray(_languages)) {
                var current = getCurrentLanguage();
                var nav = window.navigator.languages;
                if (nav == null) nav = [];
                nav.push(current);
                _languages.forEach(function(item) {
                    for (var i = 0; i < nav.length; i++) {
                        if (nav[i].indexOf(item.uniCode) === 0) {
                            res.push(item);
                            break;
                        }
                    }
                });
            }
            if (res.length > 0) {
                localStorage['selectedLanguages'] = JSON.stringify(res);
                return [res];
            }

        }

        function setSelectedLanguages(languages) {
            localStorage['selectedLanguages'] = JSON.stringify(languages);
        }

        function setCurrentLanguage(value) {
            localStorage['currentlang'] = value;
        }

        function getCurrentLanguage() {   
            if (localStorage['currentlang'] == null)
                setCurrentLanguage(window.navigator.language.substring(0, 2));
            return localStorage['currentlang'];
        }

       

        var service = {
            getLanguages: getLanguages,
            getSelectedLanguages: getSelectedLanguages,
            setSelectedLanguages: setSelectedLanguages,
            getCurrentLanguage: getCurrentLanguage,
            setCurrentLanguage: setCurrentLanguage,
            initSelectedLanguages: initSelectedLanguages
        };
        return service;
    }
);

